import styled from "styled-components";
import Home from "../Img/akar-icons_home-alt1.svg";
import Calender from "../Img/ic_baseline-calendar-month.svg";
import Search from "../Img/mingcute_search-line.svg";
import Logo from "../Img/cbi_mg.svg";
import DownArrow from "../Img/ep_arrow-down-bold.svg";
const Container = styled.div`
  width: 16.375rem;
  height: 100%;
  padding: 1rem;
  border: 1px solid black;
  gap: 2rem;
`;

const HeaderContainer = styled.div`
  width: 100%;
  height: 13rem;
  display: flex;
  padding: 0;
  gap: 0.5rem;

  > img {
    width: 45px;
    height: 45px;
  }

  > span {
    color: --dark-gray;
    font-size: 24px;
    font-weight: 400;
  }
  > div {
    display: flex;
    flex-direction: column;
  }
`;

const HeaderBox = styled.div`
  width: 100%;
  height: 13rem;
  padding: 1rem;
  display: flex;
`;

const ListBox = styled.ul`
  width: 100%;
  height: 13rem;
  padding: 1rem;
  gap: 1rem;
`;

export default function Nav() {
  return (
    <Container>
      <HeaderBox>
        <HeaderContainer>
          <img src={Logo} />
          <div>
            <span>To-Do</span>
            <span>Calender</span>
          </div>
          <button>
            <img src={DownArrow} />
          </button>
        </HeaderContainer>
      </HeaderBox>
      <ListBox></ListBox>
      <img src={Home}></img>
      <img src={Calender}></img>
      <img src={Search}></img>
    </Container>
  );
}
